import IncDecInput from "./IncDecInput";

const IncDecInputWithWords = ({val, setVal, mapArray}) => {
    return (
        <IncDecInput className={"one-navik-inp"} val={(+val >= 0 && +val <= 3) ? mapArray.get(+val) : +val} setVal={setVal}
                     decFunc={() => setVal(+val-1)} incFunc={() => setVal(+val+1)}/>

    );
};

export default IncDecInputWithWords;
